import React from 'react'

function NameList() {
    // const names = ['Bruce', 'Clark', 'Diana', 'Jonny Depp'];
    const names = [
        {
            id: 1,
            name: 'Bruce',
            age: 21,
            skill: React
        },

    ]
    const nameList = names.map(name => {
        return(
            <h2>{name}</h2>
        )
      });
    return (
        <div>
            {
                nameList
            }
        </div>
    )
}

export default NameList
